      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT + col1 IN ( + 92 + + col0, + col2, - CAST ( + - col2 AS INTEGER ) );
  - name: tab2

outputs:
  - name: q12234.out
    data: |
      46	51	23
      64	77	40
      75	67	58
